import React from 'react'
import '../pages-styles/projects.css'
import Navbar from '../component/Navbar';
import HeadingText from '../component/HeadingText';


function Projects () {
  return (
    <>
    <Navbar/>
    <HeadingText text="Projects"/>
    <ProjectsCard/>
    </>
  )
}

export default Projects;
